/*Table structure for table `pf_gmuni_department` */

CREATE TABLE `pf_gmuni_department` (
  `ID` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '主键',
  `name` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '部门名称',
  `simple_name` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '简称',
  `code` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '编码',
  `parent_id` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '父id',
  `type` varchar(10) COLLATE utf8_bin NOT NULL COMMENT '类型 0:机构 ,1:部门',
  `remark` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `create_time` datetime DEFAULT NULL COMMENT '添加时间',
  `status` char(10) COLLATE utf8_bin DEFAULT NULL COMMENT '状态，0禁用，1启用',
  `dLevel` decimal(10,0) DEFAULT NULL COMMENT '层级',
  `dLevel_code` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `faculty` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '性质',
  `sort` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '排序号',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `pf_gmuni_department` */

insert  into `pf_gmuni_department`(`ID`,`name`,`simple_name`,`code`,`parent_id`,`type`,`remark`,`create_time`,`status`,`dLevel`,`dLevel_code`,`faculty`,`sort`) values ('-1','组织机构','组织机构','dept','','0',NULL,NULL,'1','0','000',NULL,'1');

/*Table structure for table `pf_gmuni_department_part` */

CREATE TABLE `pf_gmuni_department_part` (
  `id` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '主键',
  `userId` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '人员id',
  `deptId` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '部门id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `pf_gmuni_department_part` */

/*Table structure for table `pf_gmuni_lookup` */

CREATE TABLE `pf_gmuni_lookup` (
  `ID` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '数据字典表，可以多层嵌套',
  `code` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '编码',
  `name` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '字典名称',
  `parent_id` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '字典父节点名称',
  `sort` decimal(10,0) DEFAULT NULL COMMENT '排序号',
  `status` char(10) COLLATE utf8_bin DEFAULT NULL COMMENT '0:启用  1:禁用',
  `remark` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `type` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '类型  0 目录  1 字典',
  `create_time` datetime DEFAULT NULL COMMENT '添加时间',
  `level` decimal(10,0) DEFAULT NULL COMMENT '层级',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

