/*Table structure for table `pf_gmuni_resource_privilege` */

CREATE TABLE `pf_gmuni_resource_privilege` (
  `ID` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '主键',
  `resource_code` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '资源编码',
  `priv_code` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '权限编码',
  `priv_type` char(10) COLLATE utf8_bin DEFAULT NULL COMMENT '权限类型1:组织机构 2：角色 3：工作组',
  `resource_type` char(10) COLLATE utf8_bin DEFAULT NULL COMMENT '资源类型 1:菜单 2:按钮',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

