/*Table structure for table `pf_gmuni_role` */

CREATE TABLE `pf_gmuni_role` (
  `id` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '角色主键',
  `code` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '编码',
